window.bookSummaryJSON = "<p><b>Don't miss the highly anticipated final installment of the steamy romantasy series everyone on BookTok is talking about!</b></p> <p>After Lor makes the biggest mistake of her life, she finds herself on the run from the Aurora King and decides it's time to end this, once and for all. When a new enemy emerges to claim her freedom, the entire fate of Ouranos comes to rest on her shoulders.</p> <p>As the land continues to rebel, Lor must admit she is the key to saving the continent, whether she likes it or not. To fight for Nadir, she must lie, steal, and do whatever it takes to hunt down the remaining arks. Growing more and more desperate, she worries her actions are turning her into something she doesn't recognize, dooming her to repeat her grandmother's mistakes.</p> <p>When the Aurora King finally comes for her, Lor ventures into the Underworld's shadowy depths, where, once again, she finds herself at the heart of another deadly test. Only this time, she's competing for everyone's future, not just a crown.</p> <p>The only thing Lor ever wanted was to be free, but she may soon find she was always destined for a cage.</p>"; 
